DROP TABLE IF EXISTS `bin_order_goods`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bin_order_goods` (
  `order_goods_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单ID',
  `member_goods_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '合约商品ID',
  `goods_name` varchar(200) NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_image` varchar(200) NOT NULL DEFAULT '' COMMENT '商品图片',
  `remark` varchar(200) NOT NULL DEFAULT '' COMMENT '备注',
  `number` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '数量',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '价格',
  `total_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '总价',
  PRIMARY KEY (`order_goods_id`),
  KEY `orderid` (`order_id`),
  KEY `membergoods` (`member_goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=108 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

